# dabAcCaCBAcCcaDA  The first 'cC' is removed.
# dabAaCBAcCcaDA    This creates 'Aa', which is removed.
# dabCBAcCcaDA      Either 'cC' or 'Cc' are removed (the result is the same).
# dabCBAcaDA        No further actions can be taken.
import string

do_part_2 = True

my_polymer = ""
remove_chr = "."
assert(remove_chr not in my_polymer)

def reduce(p):
	polymer_updated = True
	while polymer_updated:
		polymer_updated = False
		i,j = 0,1
		while j < len(p)-1:
			if (p[i] == p[i].upper() and p[j] == p[i].lower()) or (p[i] == p[i].lower() and p[j] == p[i].upper()):
				# found match, mark as remove
				p[i] = '.'
				p[j] = '.'
				i,j = i-1,j+1
				polymer_updated = True
			else:
				i,j = j, j+1
		if polymer_updated:
			# we do a copy after each iteration, as slicing/appending eats memory
			p = [x for x in p if x != '.']
	return p

filter_character_list = remove_chr
if do_part_2:
	filter_character_list = string.printable[10:36]

for char in filter_character_list:
	p = [ x for x in my_polymer if x != char.upper() and x != char.lower()]
	val = "".join(reduce(list(p)))
	print(char, len(val))